import {Link} from "react-router-dom";
import {useState} from "react";

export default function Navbar() {
    const [user, setUser] = useState(null);
    const [showCategories, setShowCategories] = useState(false);

    return (
        <div onClick={() => setShowCategories(false)}>
            <div className="bg-slate-800 flex items-center text-white h-16">
                <Link to={'/'} className="text-2xl font-bold px-4">Belbay</Link>

                <div className="relative">
                    <button className="text-white hover:bg-gray-700 focus:outline-none" onClick={() => setShowCategories(!showCategories)}>
                        Категории
                    </button>

                    {showCategories && (
                        <div className="absolute mt-2 bg-gray-800 text-white rounded-md shadow-lg">
                            <a href="#" className="block hover:bg-gray-700 px-4 py-2">Дом и быт</a>
                            <a href="#" className="block hover:bg-gray-700 px-4 py-2">Электроника</a>
                            <a href="#" className="block hover:bg-gray-700 px-4 py-2">Автомобили</a>
                        </div>
                    )}

                </div>

                {user && (
                    <div>

                    </div>
                )}

                {!user && (
                    <div className="ml-auto grid grid-cols-2">
                        <Link to={'/login'}>
                            <button className="border hover:bg-gray-700 rounded-lg py-2 px-2">Логин</button>
                        </Link>
                        <Link to={'/register'}>
                            <button className="border hover:bg-gray-700 rounded-lg py-2 px-2 -ml-4">Регистрация</button>
                        </Link>
                    </div>
                )}
            </div>
        </div>
    );
}
